{"1": ["Отличный ноут, обошёлся на 10к дешевле чем в магазине, спасибо wildberries.", "2021-05-09T16:47:09Z", "серый", "0", 3, 0, 5, "Ноутбук MacBook Air M1/8Gb/SSD256Gb/13.3\"WQXGA/Apple M1 7-core (2020) (MGN63RU/MGN93RU/MGND3RU)", "Apple"], "2": ["Ноут отличный без касиков, все работает, запустился сразу. Пришел в транспортировочной упаковки.", "2021-05-08T17:42:39Z", "серый", "0", 1, 0, 5, "Ноутбук MacBook Air M1/8Gb/SSD256Gb/13.3\"WQXGA/Apple M1 7-core (2020) (MGN63RU/MGN93RU/MGND3RU)", "Apple"], "3": ["Все работает исправно, мак пришёл в запечатанной родной коробке и во второй коробке для транспортировки. ", "2021-05-04T16:14:18Z", "серебристый", "0", 3, 0, 5, "Ноутбук MacBook Air M1/8Gb/SSD256Gb/13.3\"WQXGA/Apple M1 7-core (2020) (MGN63RU/MGN93RU/MGND3RU)", "Apple"], "4": ["Все отлично! Восторг от качества!", "2021-05-01T06:46:15Z", "серый", "0", 6, 0, 5, "Ноутбук MacBook Air M1/8Gb/SSD256Gb/13.3\"WQXGA/Apple M1 7-core (2020) (MGN63RU/MGN93RU/MGND3RU)", "Apple"], "5": ["Замечательный компьютер, всё упаковано хорошо, работает превосходно, единственный минус когда открыли коробку самого компьютера сильно запахло сыростью, возможно долго лежал в сыром помещении, а так всё замечательно!", "2021-04-18T04:58:48Z", "серебристый", "0", 15, 2, 5, "Ноутбук MacBook Air M1/8Gb/SSD256Gb/13.3\"WQXGA/Apple M1 7-core (2020) (MGN63RU/MGN93RU/MGND3RU)", "Apple"], "6": ["Все отлично,товар оригинальный! Переживал за доставку, но товар приходит в дополнительной  коробке+есть лента с контролем вскрытия, по которой можно понять, что сотрудники не вскрывали посылку.", "2021-04-12T16:16:09Z", "серебристый", "0", 13, 2, 5, "Ноутбук MacBook Air M1/8Gb/SSD256Gb/13.3\"WQXGA/Apple M1 7-core (2020) (MGN63RU/MGN93RU/MGND3RU)", "Apple"], "7": ["Пришёл в двух коробках. Отличная цена - 94. Ниже конкурентов . Все работает ", "2021-04-11T13:27:42Z", "золотистый", "0", 6, 2, 5, "Ноутбук MacBook Air M1/8Gb/SSD256Gb/13.3\"WQXGA/Apple M1 7-core (2020) (MGN63RU/MGN93RU/MGND3RU)", "Apple"], "8": ["Ну что сказать... он просто суперр!!", "2021-04-07T17:54:17Z", "серебристый", "0", 7, 1, 5, "Ноутбук MacBook Air M1/8Gb/SSD256Gb/13.3\"WQXGA/Apple M1 7-core (2020) (MGN63RU/MGN93RU/MGND3RU)", "Apple"], "9": ["Приходит в своей упаковке и в коробке от поставщика, с контролем вскрытия, по которой видно, что сотрудниками Wildberries упаковка не вскрывалась, все ок. На пункте выдачи вскрыли проверить целостность упаковки самого продукта (внутренней), тоже все ок. По качеству товара никаких претензий, все отлично как всегда.", "2021-04-03T10:28:36Z", "серый", "0", 15, 1, 5, "Ноутбук MacBook Air M1/8Gb/SSD256Gb/13.3\"WQXGA/Apple M1 7-core (2020) (MGN63RU/MGN93RU/MGND3RU)", "Apple"], "10": ["Макбук оригинальный без дефектов. Пришёл в двух коробках (родной и дополнительной). Всё было запечатано в плёнку. При мне вскрыли, осмотрели. Всё работает. Рекомендую!", "2021-03-25T07:22:14Z", "золотистый", "0", 21, 2, 5, "Ноутбук MacBook Air M1/8Gb/SSD256Gb/13.3\"WQXGA/Apple M1 7-core (2020) (MGN63RU/MGN93RU/MGND3RU)", "Apple"], "11": ["Пока все ок", "2021-03-13T14:16:19Z", "серебристый", "0", 5, 7, 5, "Ноутбук MacBook Air M1/8Gb/SSD256Gb/13.3\"WQXGA/Apple M1 7-core (2020) (MGN63RU/MGN93RU/MGND3RU)", "Apple"], "12": ["Больше всего переживала за доставку. Упаковано в ещё одну коробку, кроме родной. Все очень аккуратно. А сам ноут, конечно огонь. ", "2021-03-10T11:30:43Z", "серебристый", "0", 14, 1, 5, "Ноутбук MacBook Air M1/8Gb/SSD256Gb/13.3\"WQXGA/Apple M1 7-core (2020) (MGN63RU/MGN93RU/MGND3RU)", "Apple"], "13": ["Доставили быстро, все отлично. Работает супер, для разработки приложений самое то! ", "2021-02-20T07:34:16Z", "серый", "0", 13, 3, 5, "Ноутбук MacBook Air M1/8Gb/SSD256Gb/13.3\"WQXGA/Apple M1 7-core (2020) (MGN63RU/MGN93RU/MGND3RU)", "Apple"], "14": ["Пока все отлично! Упаковка была суперская) Доставка быстрая. Ноут работает, но т.к. у меня впервые макбук в руках, приходится привыкать. В общем, пятерка!", "2021-02-09T14:55:18Z", "серый", "0", 27, 3, 5, "Ноутбук MacBook Air M1/8Gb/SSD256Gb/13.3\"WQXGA/Apple M1 7-core (2020) (MGN63RU/MGN93RU/MGND3RU)", "Apple"], "15": ["Все отлично! Упаковано в две коробки. Все четко.", "2021-01-08T19:26:57Z", "золотистый", "0", 18, 6, 5, "Ноутбук MacBook Air M1/8Gb/SSD256Gb/13.3\"WQXGA/Apple M1 7-core (2020) (MGN63RU/MGN93RU/MGND3RU)", "Apple"], "16": ["Купила прям перед Новым годом. С официального сайта доставка должна была быть не раньше 4-8 недель. По счастливой случайности зашла сюда, он был в наличии, именно в желанном цвете. Единственный минус, который я заметила (не только я, нашла на форуме комментарии) - не всегда переключается язык через крайнюю левую кнопку. Помогает избавиться от этого только рестарт. Но пока это все из минусов. Покупкой довольна.", "2021-01-05T10:18:02Z", "золотистый", "0", 49, 7, 5, "Ноутбук MacBook Air M1/8Gb/SSD256Gb/13.3\"WQXGA/Apple M1 7-core (2020) (MGN63RU/MGN93RU/MGND3RU)", "Apple"], "17": ["Было немного волнительно заказывать, но все отлично. Пришёл в картонной коробке, внутри оригинальная запечатанная упаковка. Проверила серийный номер - все в порядке. Спасибо :)", "2021-01-02T14:33:33Z", "золотистый", "0", 35, 5, 5, "Ноутбук MacBook Air M1/8Gb/SSD256Gb/13.3\"WQXGA/Apple M1 7-core (2020) (MGN63RU/MGN93RU/MGND3RU)", "Apple"]}
